css:
@-moz-document domain("boks.fo") {
.x-toolbar-left,
#x-auto-4,
#x-auto-6 {
	background-color: #333 !important;
}
.x-toolbar button,
.x-btn-mc em.x-btn-arrow:after,
#x-auto-4 a,
#x-auto-6 a,
.x-tab-strip-text,
.x-grid3-hd-row span,
.x-grid3-body div,
.x-tree3-node-text,
h1,
h2,
h3,
h4,
h5,
h6,
.x-form-label,
.x-form-item-label,
.x-border.x-no-border-top.x-no-border-right.x-no-border-left,
.x-btn-mc em .x-btn-text,
.x-window-tbar,
.x-ignore.x-menu.x-component a {
	color: white !important;
}

.x-window-tbar a {
	color: lightblue !important;
	text-decoration: underline !important;
}

html body,
.x-form-item.x-hide-label .x-form-element .x-toolbar-ct .x-toolbar-left {
	background-color: white !important;
}

#x-auto-4,
#x-auto-6 {
	background-image: url("https://example.com") !important;
}

.x-btn-mc em.x-btn-arrow,
.x-grid3-hd-btn,
.x-btn-tl,
.x-btn-tr,
.x-btn-tc,
.x-btn-ml,
.x-btn-mr,
.x-btn-mc,
.x-btn-bl,
.x-btn-br,
.x-btn-bc {
	background-image: url("https://example.com") !important;
}

.x-grid3-hd-btn {
	color: white;
	background-color: #333 !important;
}

.x-grid3-hd-btn:after {
	margin-left: 3px;
}

.x-btn-mc em.x-btn-arrow:after,
.x-grid3-hd-btn:after {
	content: "▼";
}

.x-btn-over .x-btn-mc,
.x-btn-over .x-btn-ml,
.x-btn-over .x-btn-mr,
.x-btn-over .x-btn-tc,
.x-btn-over .x-btn-tl,
.x-btn-over .x-btn-tr,
.x-btn-over .x-btn-bc,
.x-btn-over .x-btn-bl,
.x-btn-over .x-btn-br,
.x-btn-menu-active .x-btn-mc,
.x-btn-menu-active .x-btn-ml,
.x-btn-menu-active .x-btn-mr,
.x-btn-menu-active .x-btn-tc,
.x-btn-menu-active .x-btn-tl,
.x-btn-menu-active .x-btn-tr,
.x-btn-menu-active .x-btn-bc,
.x-btn-menu-active .x-btn-bl,
.x-btn-menu-active .x-btn-br,
.x-menu-item-active,
.x-grid3-row-over {
	background-image: url("https://example.com") !important;
	background-color: #555 !important;
}

.x-grid3-body .x-grid3-td-checker,
.x-ignore.x-menu.x-component {
	background-image: url("https://example.com") !important;
	background-color: #333 !important;
}

.x-grid3-body .x-grid3-row-selected .x-grid3-td-numberer,
.x-grid3-body .x-grid3-row-selected .x-grid3-td-checker,
.x-grid3-body .x-grid3-row-selected .x-grid3-td-expander,
.x-ftree2-selected,
.x-ftree2-node-over,
.x-grid3-hd-over div,
td.x-grid3-hd-menu-open .x-grid3-hd-inner {
	background-image: url("https://example.com") !important;
	background-color: #666 !important;
}

.x-tab-strip-top .x-tab-right,
.x-tab-strip-top .x-tab-strip-inner,
.x-tab-strip-top .x-tab-left {
	background-image: url("https://example.com") !important;
	background-color: #333 !important;
	border-top-right-radius: 5px;
	border-top-left-radius: 5px;
}

.x-panel-noborder .x-panel-tbar-noborder .x-toolbar {
	border-bottom: 1px solid #333 !important;
}

.x-panel-tbar.x-panel-tbar-noheader.x-panel-tbar-noborder {
	background-image: url("https://example.com") !important;
	background-color: #333 !important;
}
.x-tab-panel-header-plain .x-tab-strip-spacer,
.x-border-layout-ct,
.x-border,
.x-grid3-hd-row .x-grid3-hd {
	border-color: #333 !important;
	background: #333 !important;
}
.x-grid3-row-selected {
	border-color: #333 !important;
	background-color: #666 !important;
}

.x-border-layout-ct,
.x-grid3,
.x-grid3-header,
#x-auto-32[style] {
	background: #333 !important;
}

.x-form-text,
textarea.x-form-field,
.x-form-field.x-form-text.x-form-focus,
.x-small-editor.x-panel-fbar.x-component.x-toolbar-layout-ct .x-btn-mc,
.x-small-editor.x-panel-fbar.x-component.x-toolbar-layout-ct .x-btn-ml,
.x-small-editor.x-panel-fbar.x-component.x-toolbar-layout-ct .x-btn-mr,
.x-small-editor.x-panel-fbar.x-component.x-toolbar-layout-ct .x-btn-tc,
.x-small-editor.x-panel-fbar.x-component.x-toolbar-layout-ct .x-btn-tl,
.x-small-editor.x-panel-fbar.x-component.x-toolbar-layout-ct .x-btn-tr,
.x-small-editor.x-panel-fbar.x-component.x-toolbar-layout-ct .x-btn-bc,
.x-small-editor.x-panel-fbar.x-component.x-toolbar-layout-ct .x-btn-bl,
.x-small-editor.x-panel-fbar.x-component.x-toolbar-layout-ct .x-btn-br {
	background-image: url("https://example.com") !important;
	background-color: black !important;
	color: white !important;
}
}
